// SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;

import '../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol';

abstract contract SeedBazaar is ERC165, ERC721 {

    address bazaarOwner;

    //constructor
    constructor() public {
        bazaarOwner = msg.sender;
    }

    modifier _ownerOnly(){
            require(msg.sender == bazaarOwner, "Only the bazaar owner can conduct this action");
            _;
        }

    //events
    event Transfer(address, address, uint);
    event Approval(address, address, uint);
    event ApprovalForAll(address, address, bool);

   //struct for seeds
   struct Seed{
       string name;
       string description;
       uint quantity;
   }
   Seed[] public seeds;
    EnumerableMap.UintToAddressMap private _seedOwners;
    mapping (address => EnumerableSet.UintSet) private _holderSeeds;
    mapping (uint256 => address) private _vendorApprovals;
    mapping (address => mapping (address => bool)) private _operatorApprovals;

    //mint function to register seed to a specific address
    function registerSeed(address to, string memory _name, string memory _description, uint _quantity) internal _ownerOnly {
        require(to != address(0), "No recipient address specified");
        uint id = seeds.length;
        seeds.push(Seed(_name, _description, _quantity));
        _mint(to, id);
    }
    //sell seed
    function sellSeed(address receiver, uint id) public _ownerOnly returns (bool) {
        _transfer(msg.sender, receiver, id);
        return true;
    }

    function _approve(address to, uint256 seedId) public override _ownerOnly {
        _vendorApprovals[seedId] = to;
        emit Approval(ownerOf(seedId), to, seedId);
    }

    //get address approved for a token
    function getApproved(uint256 seedId) public view virtual override returns (address) {
        require(_exists(seedId), "ERC721: approved query for nonexistent token");

        return _vendorApprovals[seedId];
    }

    //allow a vendor to sell a specific seed
    function approve(address to, uint256 seedId) public virtual override {
        address owner = ownerOf(seedId);
        require(to != owner, "ERC721: approval to current owner");

        require(_msgSender() == owner || isApprovedForAll(owner, _msgSender()),
            "ERC721: approve caller is not owner nor approved for all"
        );

        _approve(to, seedId);
    }

    //set an approval for an address giving sales rights for all seeds
    function setApprovalForAll(address operator, bool approved) public virtual override {
        require(operator != _msgSender(), "ERC721: approve to caller");

        _operatorApprovals[_msgSender()][operator] = approved;
        emit ApprovalForAll(_msgSender(), operator, approved);
    }

    //check if an address has the sales rights for all seeds
    function isApprovedForAll(address owner, address operator) public view override virtual returns (bool) {
        return _operatorApprovals[owner][operator];
    }

    //transfer seed from one account to another if you have approval or are the owner
    function transferFrom(address from, address to, uint256 seedId) public virtual override {
        //solhint-disable-next-line max-line-length
        require(_isApprovedOrOwner(_msgSender(), seedId), "ERC721: transfer caller is not owner nor approved");

        _transfer(from, to, seedId);
    }

    //safely transfer from one account to another if you are approved or the owner
    function safeTransferFrom(address from, address to, uint256 seedId) public virtual override {
        safeTransferFrom(from, to, seedId, "");
    }

    //same as above but with extra data pramater
   function safeTransferFrom(address from, address to, uint256 seedId, bytes memory _data) public virtual override {
        require(_isApprovedOrOwner(_msgSender(), seedId), "ERC721: transfer caller is not owner nor approved");
        _safeTransfer(from, to, seedId, _data);
    }
    
    //check how many seeds are at an account
    function balanceOf(address owner) public view virtual override returns (uint256) {
        require(owner != address(0), "ERC721: balance query for the zero address");

        return _holderSeeds[owner].length();
    }

    //check who owns a certain seed
    function ownerOf(uint256 tokenId) public view virtual override returns (address) {
        return _seedOwners.get(tokenId, "ERC721: owner query for nonexistent token");
    }
}
